import React, { Component } from 'react';
import {Button, Dialog, Pane} from 'evergreen-ui';

let material_type = () => {
  return (
    <div>
      <Dialog
        isShown={state.isShown}
        title="Dialog title"
        onCloseComplete={() => setState({ isShown: false })}
        confirmLabel="Custom Label">

        Dialog content
      </Dialog>
    </div>
  );

}

export {material_type};
